import React from "react";
import DayListItem from "./DayListItem";

export default function DayList(props) {
  const [ days ] = props;
  const parsedDays = [];
  for (const day of days) {
    parsedDays.push(<DayListItem {... day} />)
  }
  return (
    <ul>
      <DayListItem />
      <DayListItem />
      <DayListItem />
    </ul>
  )
}
